import Vue from "vue";
import Router from "vue-router";
Vue.use(Router);

import CleaningHours from "../components/CleaningHours.vue";

export default new Router({
  routes: [
    {
      path: "/",
      name: "CleaningHours",
      component: CleaningHours,
    },
  ],
});
